import React, { useState, useEffect } from 'react';

const VisionSummary = () => {
  const [weeklySummary, setWeeklySummary] = useState('');
  const [monthlySummary, setMonthlySummary] = useState('');
  const [yearlySummary, setYearlySummary] = useState('');
  const [activeTab, setActiveTab] = useState('weekly'); // כרטיסייה נבחרת

  // טוען סיכומים מ-Local Storage
  useEffect(() => {
    const savedSummaries = localStorage.getItem('visionSummaries');
    if (savedSummaries) {
      const { weekly, monthly, yearly } = JSON.parse(savedSummaries);
      setWeeklySummary(weekly || '');
      setMonthlySummary(monthly || '');
      setYearlySummary(yearly || '');
    }
  }, []);

  // שומר סיכומים ל-Local Storage
  const saveSummaries = () => {
    const summaries = {
      weekly: weeklySummary,
      monthly: monthlySummary,
      yearly: yearlySummary,
    };
    localStorage.setItem('visionSummaries', JSON.stringify(summaries));
    alert('✅ הסיכומים נשמרו בהצלחה!');
  };

  return (
    <div className="container mx-auto p-8 bg-white rounded-md shadow-md max-w-5xl">
      {/* כותרת */}
      <h1 className="text-3xl font-bold mb-6 text-center">📊 סיכומים שבועיים, חודשיים ושנתיים</h1>
      <p className="text-gray-600 text-center mb-8">
        כאן תוכלו להוסיף, לערוך ולסכם את ההישגים והתובנות שלכם.
      </p>

      {/* ניווט בין כרטיסיות */}
      <div className="flex gap-4 justify-center mb-6">
        <button
          onClick={() => setActiveTab('weekly')}
          className={`px-4 py-2 rounded-md ${
            activeTab === 'weekly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
          }`}
        >
          🗓️ סיכום שבועי
        </button>
        <button
          onClick={() => setActiveTab('monthly')}
          className={`px-4 py-2 rounded-md ${
            activeTab === 'monthly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
          }`}
        >
          📅 סיכום חודשי
        </button>
        <button
          onClick={() => setActiveTab('yearly')}
          className={`px-4 py-2 rounded-md ${
            activeTab === 'yearly' ? 'bg-blue-500 text-white' : 'bg-gray-200'
          }`}
        >
          🏆 סיכום שנתי
        </button>
      </div>

      {/* תוכן כרטיסיות */}
      {activeTab === 'weekly' && (
        <div className="mb-6">
          <h2 className="text-2xl font-bold mb-2">🗓️ סיכום שבועי</h2>
          <textarea
            value={weeklySummary}
            onChange={(e) => setWeeklySummary(e.target.value)}
            placeholder="כתבו את סיכום השבוע שלכם כאן..."
            className="w-full h-32 p-2 border rounded-md"
          />
        </div>
      )}

      {activeTab === 'monthly' && (
        <div className="mb-6">
          <h2 className="text-2xl font-bold mb-2">📅 סיכום חודשי</h2>
          <textarea
            value={monthlySummary}
            onChange={(e) => setMonthlySummary(e.target.value)}
            placeholder="כתבו את סיכום החודש שלכם כאן..."
            className="w-full h-32 p-2 border rounded-md"
          />
        </div>
      )}

      {activeTab === 'yearly' && (
        <div className="mb-6">
          <h2 className="text-2xl font-bold mb-2">🏆 סיכום שנתי</h2>
          <textarea
            value={yearlySummary}
            onChange={(e) => setYearlySummary(e.target.value)}
            placeholder="כתבו את סיכום השנה שלכם כאן..."
            className="w-full h-32 p-2 border rounded-md"
          />
        </div>
      )}

      {/* כפתור שמירה */}
      <div className="text-center mt-6">
        <button
          onClick={saveSummaries}
          className="bg-green-500 text-white px-6 py-2 rounded-md hover:bg-green-600"
        >
          💾 שמור סיכומים
        </button>
      </div>
    </div>
  );
};

export default VisionSummary;
